switch($data['hr_platform']){
  case 'bamboo':
    try {
      //BAMBOOHR API
      require_once('vendor/autoload.php');
      $client = new \GuzzleHttp\Client();
      $response = $client->request('GET', 'https://api.bamboohr.com/api/gateway.php/'.$data['hr_domain'].'/v1/employees/directory', [
        'headers' => [
          'accept' => 'application/json',
          'authorization' => 'Basic '.base64_encode($data['hr_apikey'].':'),
        ],
      ]);
      $requestContent = (array)json_decode($response->getBody()->getContents());
      $list = $requestContent['employees'];
      $department = getDeptByEmail($list, $data['reviewer']['email']);
      $list = getDeptEmployees($list, $department);
      return $list;

    } catch (Exception $e) {
      // output error message if fails
      return [[
        "displayName" => $data['reviewer']['name'],
        "workEmail" => $data['reviewer']['email']
      ]];
    }
    break;
  default:
    return [];
}

function getDeptByEmail($list, $email)
{
  try {
    foreach ($list as $employee) {
      if($employee->workEmail === $email){
        return $employee->department;
      }
    }
  } catch (Exception $exception) {
    throw $exception;
  }
}

function getDeptEmployees($list, $department)
{
  try {
    $employeeList = [];
    foreach ($list as $employee) {
      if(!isset($department) || $employee->department === $department){
        $employeeList[] = [
          'displayName' => $employee->displayName,
          'workEmail' => $employee->workEmail
        ];
      }
    }
    return $employeeList;
  } catch (Exception $exception) {
    throw $exception;
  }
